import { style } from "typestyle";
import TestBgImage from '../../../assets/images/testBg.png'

 const QuizPageStyle = style({
     position: 'relative',
     marginTop: '90px',
     height: '100vh',
     $nest: {
         '& .QuizRegister': {
             backgroundColor: '#FF5E5C',
             height: '100%',
            $nest: {
                '& h3': {
                    zIndex: 2,
                    position: 'absolute',
                    top: 0,
                    textAlign: 'center',
                },
                '& .wave': {
                   position: 'absolute',
                   top: 0
                },
                '& .logo': {
                   position: 'absolute',
                   top: 0
                },
            }
         },
     }
 })

 export default QuizPageStyle
